INSERT INTO `post_table` (`id_post`, `id_user`, `id_tag`, `id_category`, `title_post`, `content_post`, `image_post`, `synopsis_post`, `date_post`) VALUES
(201, 102, 1203, 1104, 'Pensil Ajaib', 'Laila adalah seorang gadis miskin yang pandai. Sebagian waktunya ia gunakan untuk belajar dan membantu orang tuanya. Selain itu, Laila juga suka menghabiskan waktunya untuk menggambar. Sayangnya, kini ia tidak dapat menggambar lagi karena pensil yang dimilikinya sudah hampir habis dan sangat pendek sehingga tidak dapat digunakan lagi. Laila juga tidak bisa membeli pensil baru karena tidak memiliki cukup uang. Dalam kesehariannya, Laila membantu orang tuanya memunguti plastik yang ada di jalan. Saat mengambil plastik, Laila menemukan ada sebuah pensil yang tergeletak di jalan. Laila mengambilnya dengan senang karena akan dapat menggambar lagi sepulang mencari plastik. Saat di rumah, Laila mulai mengeluarkan pensil yang ia temukan tadi di jalan. Laila mencoba menggambar bunga di kertasnya. Alangkah kagetnya ketika selesai menggambar, tiba-tiba menjadi bunga sesungguhnya dan tergeletak di atas kertas tempat ia menggambar. Laila merasa kaget dan tidak percaya. Ia mulai menggambar ayam untuk memastikan apakah yang ia lihat memang nyata. Sesaat setelah ia menggambar ayam, alangkah kagetnya tiba-tiba di hadapannya ada seekor ayam hidup yang berkokok sangat kencang. Kini ia menyadari bahwa ia memiliki sebuah pensil ajaib. Dengan sigap ia segera menggambar berbagai keperluan yang dibutuhkan oleh keluarganya. Ia menggambar beras, makanan, lauk-pauk, uang, dan berbagai kebutuhan lainnya. Saat orang tua Laila datang, alangkah kagetnya mereka melihat rumah dipenuhi banyak benda yang mereka butuhkan. Ibunya hampir menangis karena merasa sangat bahagia kebutuhan mereka dapat tercukupi. Meski begitu, Laila menggunakan pensil ajaibnya dengan bijak. Ia tidak sembarangan menciptakan benda dengan pensil ajaibnya. Ia tahu bahwa bersikap berlebihan nantinya akan menimbulkan petaka baik untuk dirinya maupun dengan keluarganya.', , 'Laila, seorang gadis miskin yang berbakat, menemukan pensil ajaib yang mampu mengubah gambar-gambar menjadi nyata. Dengan bijaksana, Laila menggunakan pensil tersebut untuk menggambar kebutuhan hidup keluarganya, seperti makanan dan uang, sehingga kehidupan mereka menjadi lebih baik. Meskipun demikian, Laila menyadari bahwa penggunaan pensil ajaib ini harus dijaga dengan bijak agar tidak menimbulkan konsekuensi yang tidak diinginkan. Dengan hati penuh syukur, keluarga Laila merasakan kebahagiaan yang tak terhingga atas kemurahan hati pensil ajaib itu.', '2023-06-10');
INSERT INTO `post_table` (`id_post`, `id_user`, `id_tag`, `id_category`, `title_post`, `content_post`, `image_post`, `synopsis_post`, `date_post`) VALUES
(202, 102, 1206, 1104, 'Jendela', 'Dalam keadaan yang diliputi kesedihan dan kebingungan, Murlock mencoba memahami kejadian aneh yang terjadi di hadapannya. Ia merasa ada hubungan antara suara tangisan anak hilang dan kehadiran macan tutul di rumahnya. Apakah ada keterkaitan yang belum terungkap?\r\n\r\nMurlock memutuskan untuk mengikuti petunjuk yang diberikan oleh daun telinga macan kumbang. Dengan hati-hati, ia mengikuti jejak hewan itu menuju arah hutan yang dalam. Cahaya bulan yang samar-samar menerangi jalannya saat ia berjalan melalui pepohonan yang lebat.\r\n\r\nSetelah perjalanan yang melelahkan, Murlock tiba di sebuah gua yang tersembunyi di tengah hutan. Di dalam gua, ia menemukan sebuah sarang macan tutul dengan beberapa anaknya yang tampak kelaparan. Di antara mereka, ada seorang anak yang tangisan kehilangannya terdengar tadi.\r\n\r\nMurlock menyadari bahwa anak macan tutul ini telah kehilangan ibunya dan terpisah dari keluarganya. Tanpa ragu, ia memutuskan untuk membantu dan melindungi anak macan tutul tersebut. Murlock memberi makan anak macan tutul dan membangun tempat tinggal yang aman untuk mereka di dekat rumahnya.\r\n\r\nSeiring berjalannya waktu, Murlock dan anak macan tutul tersebut membentuk ikatan yang kuat. Anak macan tutul itu, yang diberi nama Luna, menjadi teman dan penghibur bagi Murlock dalam kesendirian dan kesedihannya. Mereka menjalani kehidupan yang saling memberikan dukungan dan kehangatan satu sama lain.\r\n\r\nDalam perjalanan mereka bersama, Murlock belajar bahwa takdir mereka bersama tidaklah kebetulan semata. Macan tutul di gua adalah makhluk gaib yang menjaga hutan dan menjalankan tugas penting dalam menjaga keseimbangan alam. Luna terpilih untuk menjadi penghubung antara dunia manusia dan dunia makhluk gaib tersebut.\r\n\r\nKini, Murlock dan Luna bekerja sama untuk melindungi hutan dan desa mereka dari ancaman yang datang. Mereka menjalankan tugas mereka dengan penuh dedikasi, menggunakan kekuatan dan pengetahuan yang mereka miliki untuk menjaga keseimbangan dan keharmonisan alam.\r\n\r\nDalam setiap langkah mereka, Murlock dan Luna menghadapi tantangan dan bahaya. Namun, dengan keberanian dan kepercayaan satu sama lain, mereka berhasil melalui semua rintangan dan menjadikan hutan dan desa mereka tempat yang aman dan damai.\r\n\r\nDalam prosesnya, Murlock menemukan makna baru dalam hidupnya. Ia menyadari bahwa kehilangan yang ia alami memberinya kesempatan untuk menemukan tujuan baru dan menjadi bagian dari sesuatu yang lebih besar. Bersama Luna, ia menemukan kedamaian dan pengertian yang ia cari.\r\n\r\nDengan alam sebagai saksi, Murlock dan Luna terus menjaga hutan dan desa dengan penuh dedikasi. Kisah mereka menjadi legenda di antara penduduk desa, mengilhami orang-orang untuk menjaga alam dan menemukan arti yang lebih dalam dalam kehidupan mereka.', , 'Murlock, seorang penduduk desa, menyaksikan istrinya yang terbaring sakit parah hingga meninggal. Saat tertidur, ia terbangun oleh tangisan mirip anak hilang. Dalam kegelapan, Murlock menemukan kehadiran misterius: seekor macan tutul menggenggam leher sang istri. Dengan telinga macan kumbang terjepit di giginya, Murlock menyadari bahwa binatang itu telah membawa hidup baru kepada istrinya sebelum mengakhiri nasib tragisnya.', '2023-06-10');
INSERT INTO `post_table` (`id_post`, `id_user`, `id_tag`, `id_category`, `title_post`, `content_post`, `image_post`, `synopsis_post`, `date_post`) VALUES
(203, 101, 1213, 1101, 'Kesalahan Umum tentang Hewan', 'Banyak anak kecil yang memanggilnya dengan sebutan \"Ikan Paus\". Saya sih lumrah, soalnya kan masih kecil belum memahami betul tentang pengelompokkan hewan. Apalagi Paus hanya hidup di laut, saya dulu kecil ya nyebutnya \"Ikan Paus\". Yang bikin saya jengkel itu kalau ada suatu media yang menggunakan judul clickbait seperti ini:\r\n\r\nYa emang paus bukan ikan, gimana sih. Judul seperti itu menurut saya seolah-olah paus yang kita tahu yang habitatnya di laut adalah ikan. Padahal ya emang dari dulu bukan, cuman penyebutannya yang salah. Apalagi judul di video kedua, dengan memberikan judul \"Ikan Paus\" kaya orang mau ngasih info asal-asalan. Baru nemu fakta yang menarik, langsung disebarkan tanpa tau detail minor suatu informasi terkait.\r\n\r\nBukan paus dan juga bukan lumba-lumba. Meskipun hampir serupa, tapi pesut berbeda dengan lumba-lumba. Apa yang membedakan pesut dengan lumba-lumba? Dilihat secara sekilas sudah terlihat perbedaannya, namun akan saya jelaskan.\r\n\r\nPertama paruh atau moncongnya, moncong pesut tidak begitu menonjol seperti lumba-lumba, meskipun beberapa spesies lumba-lumba tidak selalu bermoncong panjang, seperti Orca atau Paus Pembunuh. Giginya pun berbeda, gigi pesut berbentuk sekop, sedangkan lumba-lumba berbentuk kerucut.\r\n\r\nKemudian dorsal atau sirip punggungnya, sirip lumba-lumba melengkung atau bengkok, sedangkan pesut bisa anda lihat di gambar, sirip punggungnya berbentuk segitiga. Untuk lebih jelasnya bisa dibaca disini.\r\n\r\nSekian jawaban saya, jika ada yang salah bisa anda koreksi.\r\n\r\nTerima kasih.', , 'Banyak anak memanggilnya \"Ikan Paus\" karena kekeliruan pengelompokkan hewan. Namun, judul clickbait yang menyebut paus sebagai ikan membuat saya jengkel. Paus dan lumba-lumba berbeda, terlihat pada moncong, gigi, dan sirip punggung. Terima kasih.', '2023-06-10');
INSERT INTO `post_table` (`id_post`, `id_user`, `id_tag`, `id_category`, `title_post`, `content_post`, `image_post`, `synopsis_post`, `date_post`) VALUES
(204, 103, 1206, 1104, 'Guru Bahasa Inggris', 'Suatu hari kami kedatangan guru baru di sekolah. Ia merupakan seorang guru wanita yang mengajar bahasa inggris. Setelah satu minggu mengajar aku yang tidak terlalu suka dengan guru tersebut tidak begitu memperhatikan. Namun Julia teman sebangkuku memperhatikan tahi lalat di wajah sang guru selalu berubah-ubah. Dan hal itu ia tanyakan langsung kepada gurunya di tengah pelajaran berlangsung. “Kenapa tahi lalat bu Guru hari ini satu dan kemarin ada tiga?” “Ngaco kamu, tahi lalat ibu hanya satu, udah jangan mikir yang aneh-aneh, kerjakan tugasmu.” Ucap bu guru. Setelah kejadian itu Julia tidak terlihat masuk sekola lagi, 2 hari, seminggu bahkan sebulan. Aku yang penasaran pun menghubungi keluarganya. Dan ternyata Julia hilang entah kemana. Tapi di lihat dari pemberitahuan google Map ku bahwa terakhir ia ada di sebuah apartemen. Dan ternyata itu adalah apartemen bu guru. Aku yang mulai menguntit mereka ternyata mulai paham. Bu guru tersebut adalah kembar dan pak penjaga sekolah adalah suaminya. Dan betapa kagetnya aku di dalam kulkas mereka ada beberapa bagian tubuh yang sudah di potong. Dan ada sebuah kepala dan itu kepala temanku Julia. Setelah mereka menghilang aku mulai keluar dari rumah itu. Dan kabur secepatnya. Aku benar-benar ketakutan. Dan setiap malam aku di hantui kepala Julia yang selalu minta tolong kepadaku. Aku seperti orang gila.', , 'Kedatangan seorang guru wanita baru di sekolah menjadi awal mula kejadian mengerikan. Teman sebangkuku, Julia, menghilang setelah mencurigai sesuatu pada wajah guru tersebut. Penyelidikan mengarahkan pada sebuah apartemen, di mana terungkap bahwa sang guru adalah pembunuh berantai. Kepala Julia ditemukan dalam kulkas, dan narator yang ketakutan harus melarikan diri dari teror yang menghantuinya.', '2023-06-10');
INSERT INTO `post_table` (`id_post`, `id_user`, `id_tag`, `id_category`, `title_post`, `content_post`, `image_post`, `synopsis_post`, `date_post`) VALUES
(205, 106, 1203, 1102, 'Sang Pemburu', 'Pagi yang cerah menyambut Kamura Village, desa yang terletak di tengah-tengah hutan yang subur. Di tengah desa, seorang Hunter muda bernama Hiroshi bersiap-siap untuk mengawali hari barunya sebagai pemburu. Dia mempersiapkan senjata dan peralatan yang diperlukan untuk melawan monster-monster yang mengancam desa.\r\n\r\nHiroshi adalah seorang pemburu berbakat yang telah menjalani pelatihan keras di bawah bimbingan Master Hikaru, seorang pemburu yang dihormati di Kamura Village. Dia berjuang untuk melindungi desa dari ancaman monster dan membantu menjaga keseimbangan alam.\r\n\r\nHari ini, Hiroshi mendapat tugas istimewa. Ia harus melacak dan menghadapi monster yang telah mengganggu keseimbangan di hutan terlarang. Monster itu adalah Narwa the Allmother, sejenis Elder Dragon yang sangat kuat. Keberadaannya mengancam kehidupan desa, dan Hiroshi ditugaskan untuk menghentikannya.\r\n\r\nBersama dengan Felyne peliharaannya, Hiroshi memasuki hutan terlarang. Langkahnya hati-hati di antara pepohonan yang rimbun, menyerap aura yang tegang di udara. Dia mengikuti jejak-jejak besar yang ditinggalkan oleh Narwa, menunjukkan keberadaan monster yang mengagumkan itu.\r\n\r\nSetelah berjam-jam melacak, Hiroshi akhirnya menemukan Narwa di dalam gua yang tersembunyi. Monster tersebut menjulang tinggi, dikelilingi oleh kilatan listrik yang memancar dari tubuhnya. Hiroshi menggenggam erat senjatanya dan bersiap untuk pertempuran yang sulit.\r\n\r\nDalam pertempuran yang berkecamuk, Hiroshi menggunakan keahliannya dalam memanfaatkan Wirebug untuk melakukan serangan akrobatik dan menghindari serangan Narwa. Namun, Narwa bukan lawan yang mudah dikalahkan. Monster itu melepaskan ledakan energi listrik yang mengguncang tanah dan merobek angkasa.\r\n\r\nHiroshi merasakan kelelahan, tapi tekadnya tidak pernah luntur. Dia terus melawan dengan gigih, memanfaatkan kekuatan dan ketahanan yang dimilikinya. Dia berhasil melukai Narwa dengan serangkaian serangan yang presisi, memperoleh kepercayaan diri yang semakin kuat.\r\n\r\nSetelah pertarungan yang sengit dan melelahkan, Hiroshi mampu menjatuhkan Narwa the Allmother. Tubuh monster itu jatuh dengan gemuruh, mengguncang gua yang gelap. Hiroshi bernapas lega, merasakan kemenangan yang diraihnya dengan pengorbanan dan ketabahan.\r\n\r\nKetika dia kembali ke Kamura Village, dia disambut sebagai pahlawan. Penduduk desa memenuhi jalanan, memberikan penghargaan dan ucapan terima kasih atas pengabdian Hiroshi dalam melindungi desa. Master Hikaru melangkah maju dan mengangkat Hiroshi sebagai pemburu yang dihormati, mengakui ketangguhan dan keberanian yang ditunjukkan oleh muridnya.\r\n\r\nHiroshi memandang ke langit yang cerah, menghela nafas lega. Dia tahu bahwa pekerjaan seorang pemburu tidak akan pernah berakhir, tetapi ia siap menghadapi tantangan baru yang menunggunya. Sebagai seorang Hunter yang penuh semangat, Hiroshi akan terus melindungi Kamura Village dan menjaga keseimbangan alam dari ancaman monster yang datang.', , 'Di Kamura Village, Hunter muda bernama Hiroshi berjuang melawan monster-monster yang mengancam desa. Tugas istimewanya adalah menghadapi Narwa the Allmother, Elder Dragon yang misterius. Dalam pertempuran yang sulit, Hiroshi meraih kemenangan dan mendapat penghargaan dari penduduk desa. Dengan semangat yang tak tergoyahkan, Hiroshi melanjutkan perannya dalam menjaga keseimbangan alam.', '2023-06-19');
INSERT INTO `post_table` (`id_post`, `id_user`, `id_tag`, `id_category`, `title_post`, `content_post`, `image_post`, `synopsis_post`, `date_post`) VALUES
(206, 105, 1207, 1103, 'Musuh Negara', 'Bjorka Hacker adalah seorang fenomena viral di Indonesia yang menarik perhatian publik dengan keahliannya dalam dunia hacking. Identitas asli dan latar belakang Bjorka Hacker masih dikelilingi oleh misteri yang terjaga dengan baik, menambahkan nuansa misterius pada figur ini. Dalam sejumlah tindakan hacking yang dilakukan, Bjorka Hacker berhasil meretas sistem keamanan yang kuat dan mengekspos kerentanan yang ada di dalamnya. Tindakannya tidak hanya mempengaruhi institusi besar dan perusahaan terkemuka, tetapi juga mencuri perhatian masyarakat luas yang terbelah antara penghormatan akan keahliannya dan keprihatinan akan akibat-akibat yang mungkin ditimbulkan. Diskusi mengenai etika dan moralitas aktivitas hacking semakin memanas dengan kemunculan Bjorka Hacker, dan keberadaannya menjadi sebuah fenomena yang mencerminkan dinamika dunia digital dan tantangan yang dihadapinya. Meskipun belum ada informasi yang jelas tentang apa yang mendorong Bjorka Hacker untuk melakukan tindakan hacking, kehadiran dan dampaknya dalam jagat digital Indonesia tetaplah menjadi cerita menarik yang menyisakan banyak tanya dan ingin diungkapkan.', , 'Bjorka Hacker, sosok misterius di balik fenomena viral di Indonesia, dengan keahlian hacking yang mencuri perhatian publik dan memicu pertanyaan yang belum terjawab.', '2023-06-19');
INSERT INTO `post_table` (`id_post`, `id_user`, `id_tag`, `id_category`, `title_post`, `content_post`, `image_post`, `synopsis_post`, `date_post`) VALUES
(207, 103, 1201, 1101, 'Jual Pulau', '\"Jual pulau\", \"So bakso\", \"Gak bahaya ta?\", \"Bukan saya pak\", \"Besok gw ngilang\".\r\n\r\nKira-kira kalimat-kalimat itu sering muncul sebagai lelucon ketika ada pembahasan tentang Bu Mega dan PDI-Perjuangan di media sosial sebelah. Khusus untuk jual pulau, lelucon ini terus bermunculan di platform tersebut dan netizen bukannya berpikir kristis dan mempertanyakan pulau mana yang dijual oleh ibu Megawati? Kapan ibu Megawati menjual pulau? dan kepada siapa ibu Megawati menjual pulau? Malahan lelucon ini terus diulang-ulang.\r\n\r\nJika mengetikan \"pulau yang di jual bu mega\" di mesin pencari seperti google ataupun bing, maka akan muncul berbagai artikel, tapi yang menarik adalah dari artikel-artikel yang mucul, tidak ada yang bisa menjawab ketiga pertanyaan sebelumnya.\r\n\r\nMaka untuk itu, karena lelucon jual pulau ini dikaitkan dengan ibu Megawati, maka perlu dikulik terlebih dahulu masa kepimimpinan beliau sebagai presiden Indonesia. Ibu Megawati menjadi presiden setelah menggatikan presiden Gus Dur yang mandatnya dicabut oleh MPR, masa kepemimpinannya terhitung dari tahun 2001–2004.\r\n\r\nSelama pemerintahan beliau yang berlangsung tiga tahun, tercatat ada dua pulau dalam tanda kutip lepas dari wilayah Indonesia, kedua pulau tersebut adalah pulau Sipadan dan pulau Ligitan. Kedua pulau tersebut sampai saat ini menjadi bagian dari wilayah negara Malaysia.\r\n\r\n\r\nPada tahun 1967 Indonesia dan Malaysia sama-sama memasukan pulau Sipadan dan Ligitan sebagai wilayah negaranya. Sengketa pun dimulai dimana kedua negara merasa bahwa kedua pulau tersebut adalah bagian dari wilayahnya. Sengketa ini berlangsung cukup lama, sehingga kedua negara bersepakat untuk membawa permasalahan ini ke Mahkamah Internasional.\r\n\r\nKetika dibawa ke Mahkamah Internasional, ditemukanlah akar dari permasalah sengketa pulau Sipadan dan Ligitan. Sengketa ini terjadi karena ketidak jelasan Belanda dan Inggris dalam membuat aturan batasan di kedua pulau tersebut di masa lalu.\r\n\r\nDi Mahkamah Internasional Malaysia mengajukan bukti catatan sejarah, yang isinya adalah Ingris sebagai penemu kedua pulau tersebut, catatan itu juga diperkuat dengan fakta bahwa Inggris membangun mercusuar dan konservasi penyu. Sedangkan catatan sejarah yang diajukan Indonesia cuma menunjukan bahwa Belanda cuma sempat singgah di kedua pulau tersebut.\r\n\r\nAlhasil Mahkamah Internasional pada tahun 2002 memutuskan bahwa pulau Sipadan dan Ligitan adalah bagian dari wilayah Malaysia. Atau dengan kata lain kedua pulau tersebut dalam tanda kutip lepas dari wilayah Indonesia dan saat itu adalah masa kepemimpinan ibu Megawati.\r\n\r\nKira-kira itu hal yang berhubungan dengan pulau ketika pemerintahan ibu Megawati. Jadi sebelum menjawab pertanyaan \"Pulau apa yang akan dijual jika Puan menjadi presiden?\" Maka jawab ketiga pertanyaan sebelumnya terlebih dahulu. Pulau mana yang dijual oleh ibu Megawati? Kapan ibu Megawati menjual pulau? dan kepada siapa ibu Megawati menjual pulau?', , 'Pulau mana yang dijual oleh ibu Megawati? Kapan ibu Megawati menjual pulau? dan kepada siapa ibu Megawati menjual pulau?', '2023-06-19');

